import React, { useCallback } from "react";
import PropTypes from "prop-types";

const PostForm = () => {
  const onSubmit = useCallback(() => {}, []);

  return (
    <div>
      <Form onFinish={onSubmit}></Form>
    </div>
  );
};

PostForm.propTypes = {};

export default PostForm;
